import React, { Component } from 'react';

export default class CreateTransaction extends Component {

    constructor(props) {
        super(props);
        this.state = {
          username: '',
          role: '',
          amount: 0,
          users: []
        }
      }

      onChangeUsername(e) {
        this.setState({
          username: e.target.value
        });
      }
      onChangeRole(e) {
        this.setState({
          role: e.target.value
        });
      }
      onChangeAmount(e) {
        this.setState({
          amount: e.target.value
        });
      }
      

  render() {
    return (
      <div>
        <p>You are on the Create Transaction component!</p>
      </div>
    )
  }
}
